contracts/Permission.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.2;

contract Permissions {
    address owner;
    enum Access {
        create,
        update,
        remove,
        read
    }

    
    constructor(){
        owner = msg.sender;
    }

    modifier onlyOwner() {
        require(msg.sender == owner, "Only admin can perform this action");
        _;
    }


    mapping(address => mapping(Access => bool)) public userPermissions;

    function setAccess(address user, Access accessLevel)  external  onlyOwner {
        userPermissions[user][accessLevel] = true;
    }

    function hasAccess(address user, Access accessLevel) external view onlyOwner returns (bool) {
        return userPermissions[user][accessLevel];
    }


  

 
}

